def get_term_info(key):
    """
    Retrieve num_terms, coe, and var_cnts for a given key in the dictionary.

    Parameters:
    key (str): The key to look up in the dictionary.

    Returns:
    tuple: A tuple containing (num_terms, coe, var_cnts) if the key exists,
           otherwise returns None.
    """
    if key in dict_keys:
        entry = dict_keys[key]
        return entry['num_terms'], entry['coe'], entry['var_cnts']
    else:
        return None

